import React from "react";
import "../styles/Profile.css";

export default class goalType extends React.Component {
  next = (e) => {
    this.props.nextStep();
  };

  toPersonal = (e) => {
    e.preventDefault();
    this.props.specifyState("personal");
    this.next();
  };

  toSocial = (e) => {
    e.preventDefault();
    this.props.specifyState("social");
    this.next();
  };

  render() {
    return (
      <div className="formContainer">
        <div className="text">
          <h1>What is your goal?</h1>
        </div>
        <div className="buttonContainer">
          <button className="selectButton" handleClick={this.toPersonal}>
            Personal
          </button>
          &nbsp;&nbsp;&nbsp;&nbsp;
          <button className="selectButton" handleClick={this.toSocial}>
            Social
          </button>
        </div>
      </div>
    );
  }
}
